contracts/AddUser.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.7;

contract AddUser {
    uint256 public id;
    struct User{
        uint256 id;
        address useraddress;
        uint256 timestamp;
        string name;
        string datahash;
    }

    event userRecord(
        uint256 id,
        address indexed useraddress,
        uint256 timestamp,
        string name,
        string datahash
    );

    mapping(uint256 => User) public users;
    mapping(address => User) public userByAddress;
    address[] private userAddress;

    function addUser(
        address useraddress,
        string memory name,
        string memory datahash
    ) public {
        require(bytes(name).length > 0, "Name cannot be empty");

        id++;

        User memory newUser= User(
            id,
            useraddress,
            block.timestamp,
            name,
            datahash
        );

        users[id]=newUser;
        userByAddress[useraddress] = newUser;

        userAddress.push(useraddress);

        emit userRecord(
            id,
            useraddress,
            block.timestamp,
            name,
            datahash
        );


    }

    function getUserData(uint256 id) public view returns (
        uint256 ,
        address ,
        uint256 ,
        string memory,
        string memory
    ){
        User storage userData = users[id];

        return(
            userData.id,
            userData.useraddress,
            userData.timestamp,
            userData.name,
            userData.datahash
        );
    }

    function getid() public view returns (uint) {
        return id;
    }
    function getname() public view returns (string memory) {
        return users[id].name;
    }
    function getTimeStamp() public view returns (uint) {
        return users[id].timestamp;
    }
}

contracts/Lock.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.7;

// Uncomment this line to use console.log
// import "hardhat/console.sol";

contract Lock {
    uint public unlockTime;
    address payable public owner;

    event Withdrawal(uint amount, uint when);

    constructor(uint _unlockTime) payable {
        require(
            block.timestamp < _unlockTime,
            "Unlock time should be in the future"
        );

        unlockTime = _unlockTime;
        owner = payable(msg.sender);
    }

    function withdraw() public {
        // Uncomment this line, and the import of "hardhat/console.sol", to print a log in your terminal
        // console.log("Unlock time is %o and block timestamp is %o", unlockTime, block.timestamp);

        require(block.timestamp >= unlockTime, "You can't withdraw yet");
        require(msg.sender == owner, "You aren't the owner");

        emit Withdrawal(address(this).balance, block.timestamp);

        owner.transfer(address(this).balance);
    }
}

